  plan,
  noOfUsers,
  strgAmount,
  noOfProjects,
  comAcc,
  privAcc,
  phnSup,
  subDom,
  statRep,
}) {
  return (
    <div>
      <h3>{title}</h3>
      <h1>${plan}/month</h1>
      <hr></hr>
      <ul>
        <li>{noOfUsers} User</li>
        <li>{strgAmount}GB Storage</li>
        <li>{noOfProjects} Public Projects</li>
        <li>{comAcc}</li>
        <li>{privAcc}</li>
        <li>{phnSup}</li>
        <li>{subDom}</li>
        <li>{statRep}</li>
      </ul>
    </div>
  );
}
